import CssBaseline from '@mui/material/CssBaseline';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import * as React from 'react';

import FormInputs from './component/FormInputs';
import {

  Button,
  TextField,

  Typography,
  InputLabel,

} from "@mui/material";

function App() {
  return (<>
<React.Fragment>
      <CssBaseline />
      <Container maxWidth="sm">
        <Box sx={{ bgcolor: '#cfe8fc', height: '100vh' }} />
      </Container>
    </React.Fragment>
    <div className="App">
      <form>
      <TextField id="outlined-basic" label="Bank Name" variant="outlined" />
      <TextField id="outlined-basic" label="Outstanding Amount" variant="outlined" />
      <TextField id="outlined-basic" label="Interest Rate " variant="outlined" />
      <TextField id="outlined-basic" label="Interest Type" variant="outlined" />
      <TextField id="outlined-basic" label="Loan Type" variant="outlined" />
      <TextField id="outlined-basic" label="Term" variant="outlined" />
      <TextField id="outlined-basic" label="Properties" variant="outlined" />
      <TextField id="outlined-basic" label="Additional Securities" variant="outlined" />
      <TextField id="outlined-basic" label="Additional Securities" variant="outlined" />

      </form>





        <Button variant="contained">Hello World</Button>;

    </div>
    </>
  );
}

export default App;
